import React,{useState} from 'react'

const App = () => {
  const [name,setName]=useState("skillhub");
  return (
    <div>
      <center>
      <h1>{name}</h1>
      <button onclick ={() =>  setName("teludu skillhub")}>change</button>
      </center>
    </div>
  )
}

export default App
